import React from 'react';
import Carousel from 'react-bootstrap/Carousel'

class BookItem extends React.Component{
    render(){
        return(
         <>
         {this.props.item.map(book=>{
             <Carousel>
             <Carousel.Item>
               <img
                 className="d-block w-100"
                 src={book.imgUrl}

               />
               <Carousel.Caption>
                 <h3>{book.title}</h3>
                 <p>{book.description}</p>
               </Carousel.Caption>
             </Carousel.Item>
             <Carousel.Item>
               <img
                 className="d-block w-100"
                 src={book.imgUrl}

               />

               <Carousel.Caption>
               <h3>{book.title}</h3>
                 <p>{book.description}</p>
               </Carousel.Caption>
             </Carousel.Item>
             <Carousel.Item>
               <img
                 className="d-block w-100"
                 src={book.imgUrl}
               />

               <Carousel.Caption>
               <h3>{book.title}</h3>
                 <p>{book.description}</p>
               </Carousel.Caption>
             </Carousel.Item>
           </Carousel>
         })
          }
         </>
        )
    }
}
export default BookItem;
